import React, { Component } from 'react';
import './Content.css';
import GButton from './Contents/GButton'
import SH from '../Content/show.png'


class Content extends Component {

    render() {
        return (
            <div >
                <div className="pic" class="container-fluid" >
                    <div className="pic" class="row" >
                        <div className="pic" align="center" class="col-lg-12 col-xs-5 col-sm-12" >
                        <img className="pic" src ={SH} width="100%"  /><br/><br/>
                        </div>
                    </div>
                </div>
                
                <div class="container-fluid" >
                    <div class="row" >
                        <div class="col-lg-12" >
                        <GButton />
                        </div>
                    </div>
                </div>

                
            </div>



        );
    }
}
export default Content;
